import React from 'react';
import { GoogleLogin } from 'react-google-login';

function Dashboard() {
  const responseGoogle = (response) => {
    console.log(response);
    // Handle the response here, for example, send the token to the backend
    if (response && response.tokenId) {
      // Send the tokenId to your backend for verification
      // Example: axios.post('/auth/google', { tokenId: response.tokenId });
      console.log('Received tokenId:', response.tokenId);
    } else {
      // Handle error or missing tokenId
      console.error('Invalid response or missing tokenId');
    }
  };

  return (
    <div>
      <h1>Welcome</h1>
      <GoogleLogin
        clientId="YOUR_GOOGLE_CLIENT_ID" // Replace with your Google Client ID
        buttonText="Login with Google"
        onSuccess={responseGoogle}
        onFailure={responseGoogle}
        cookiePolicy={'single_host_origin'}
      />
    </div>
  );
}

export default Dashboard;
